const TrackDisplay = ({ trackName, trackAlbumCoverUrl, trackAlbum, trackArtists, trackAudioUrl }) => {
  const playAudio = () => {
    trackAudioUrl.play()
  }

  return (
    <div>
      <h1>{trackName}</h1>
      <img src={trackAlbumCoverUrl} alt="" />
      <br/>
      <button onClick={playAudio}>30-second preview of the vibes</button>
      <h2>{trackAlbum}</h2>
      <h2>{trackArtists}</h2>
    </div>
  )
}

export default TrackDisplay
